import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import RepositoriesList from './RepositoriesList';
import RepositoryDetails from './RepositoryDetails';
import './App.css';

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/repositories">Repositories</Link></li>
          <li><Link to="/sync">Sync</Link></li>
        </ul>
      </nav>
      <div className='container'>
        <h1>Github Trending App</h1>
        <Routes>
          <Route exact path="/" element={< RepositoriesList />} />
          <Route path="/repository/:id" element={<RepositoryDetails />} />
          <Route path="/repositories" element={<RepositoriesList />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
